INSERT INTO `movie` VALUES (1,'Amy Sedaris, Jeff Goldblum, James Marsden','Hành động','Anthony Russo',169,1,'Tiếng Anh với phụ đề tiếng Việt và lồng tiếng Việt','https://i.imgur.com/tWMQhkV.png','Biệt Đội Siêu Anh Hùng 3: Cuộc Chiến Vô Cực sẽ đưa người xem đến với cuộc chiến định mệnh giữa nhóm Avengers, các anh hùng của Trái Đất, Đội Vệ binh Dải ngân hà với bạo chúa vũ trụ Thanos.','Avenger: Infinity war','P - PHIM DÀNH CHO MỌI ĐỐI TƯỢNG','2020-12-24','Biệt Đội Siêu Anh Hùng 3: Cuộc Chiến Vô Cực sẽ đưa người xem đến với cuộc chiến định mệnh giữa nhóm Avengers, các anh hùng của Trái Đất, Đội Vệ binh Dải ngân hà với bạo chúa vũ trụ Thanos. Đây là một kẻ thù vô cùng hùng mạnh, hắn từng đứng đằng sau giật dây nhiều sự kiện trong các phần khác với dã tâm cuối cùng là chiếm được sáu Viên đá Vô cực (Infinity Stones) nằm rải rác khắp vũ trụ.','https://upload.wikimedia.org/wikipedia/vi/e/e8/Avengers-Infinity_War-Official-Poster.jpg','https://www.youtube.com/embed/6ZfuNTqbHE8'),(2,'Wasabi Mizuta, Megumi Oohara, Yumi Kakazu, Subaru Kimura, Tomokazu Seki','Hoạt hình','Tom McGrath',105,1,'Tiếng Anh với phụ đề tiếng Việt và lồng tiếng Việt','https://www.cgv.vn/media/banner/cache/1/b58515f018eb873dafa430b6f9ae0c1e/d/o/doreamon.jpg','Nhóc trùm Ted giờ đây đã trở thành một triệu phú nổi tiếng trong khi Tim lại có một cuộc sống đơn giản bên vợ anh Carol và hai cô con gái nhỏ yêu dấu. Mỗi mùa Giáng sinh tới, cả Tina và Tabitha đều mong được gặp chú Ted nhưng dường như hai anh em nhà Templeton nay đã không còn gần gũi như xưa. Nhưng bất ngờ thay khi Ted lại có màn tái xuất không thể hoành tráng hơn khi đáp thẳng máy bay trực thăng tới nhà Tim trước sự ngỡ ngàng của cả gia đình.','Doraemon: Ôi Bạn Ơi 2','P - PHIM DÀNH CHO MỌI ĐỐI TƯỢNG','2020-12-24','Nhóc trùm Ted giờ đây đã trở thành một triệu phú nổi tiếng trong khi Tim lại có một cuộc sống đơn giản bên vợ anh Carol và hai cô con gái nhỏ yêu dấu. Mỗi mùa Giáng sinh tới, cả Tina và Tabitha đều mong được gặp chú Ted','https://www.cgv.vn/media/catalog/product/cache/1/small_image/240x388/dd828b13b1cb77667d034d5f59a82eb6/p/o/poster_doremon_2_1__1.jpg','https://www.youtube.com/embed/GXnOs4Hj8MA'),(3,'Tom Hardy, Michelle Williams, Woody Harrelson, Naomie Harris','Hành Động, Khoa Học Viễn Tưởng, Phiêu Lưu','Andy Serkis',97,1,'Tiếng Anh với phụ đề tiếng Việt và lồng tiếng Việt','https://i.imgur.com/S92RzbU.png','Siêu bom tấn #VENOM: LET THERE BE CARNAGE hứa hẹn trận chiến khốc liệt nhất giữa Venom và kẻ thù truyền kiếp, Carnage.\",','Venom: Đối Mặt Tử Thù','P - PHIM DÀNH CHO MỌI ĐỐI TƯỢNG','2020-12-20','Siêu bom tấn #VENOM: LET THERE BE CARNAGE hứa hẹn trận chiến khốc liệt nhất giữa Venom và kẻ thù truyền kiếp, Carnage.\",','https://www.cgv.vn/media/catalog/product/cache/1/small_image/240x388/dd828b13b1cb77667d034d5f59a82eb6/p/o/poster_venom_121121_1__1.jpg','https://www.youtube.com/embed/EVWdzVtSh1I'),(4,'Keanu Reeves, Carrie-Anne Moss, Yahya Abdul-Mateen II, Jessica Henwick, Jonathan Groff, Neil Patrick Harris, Priyanka Chopra Jonas và Christina Ricci','Hành động','Lana Wachowski',148,1,'Tiếng Anh với phụ đề tiếng Việt và lồng tiếng Việt','https://www.cgv.vn/media/banner/cache/1/b58515f018eb873dafa430b6f9ae0c1e/b/l/blackpink-rolling_1_.jpg','Ma Trận: Hồi Sinh là phần phim tiếp theo rất được trông đợi của loạt phim “Ma Trận” đình đám, đã góp phần tái định nghĩa thể loại phim khoa học viễn tưởng. Phần phim mới nhất này đón chào sự trở lại của cặp đôi Keanu Reeves và Carrie-Anne Moss với vai diễn biểu tượng đã làm nên tên tuổi của họ, Neo và Trinity. Ngoài ra, phim còn có sự góp mặt của dàn diễn viên đầy tài năng gồm Yahya Abdul-Mateen II, Jessica Henwick, Jonathan Groff, Neil Patrick Harris, Priyanka Chopra Jonas và Christina Ricci.','Ma Trận: Hồi Sinh','C18 - PHIM CẤM KHÁN GIẢ DƯỚI 18 TUỔI','2020-12-20','Sau 20 năm, siêu phẩm ma trận đã trờ lại với người xem, Neo is back! Liệu đây có phải phần kết cho franchise này','https://www.cgv.vn/media/catalog/product/cache/1/small_image/240x388/dd828b13b1cb77667d034d5f59a82eb6/p/o/poster_matrix_4_1__1.jpg','https://www.youtube.com/embed/l2UTOJC5Tbk'),(5,'Ansel Elgort, Rachel Zegler, Ariana DeBose, David Alvarez, Mike Faist, Josh Andrés Rivera, Ana Isabelle, Corey Stoll, Brian d’Arcy James, Rita Moreno','Nhạc kịch, Tình cảm','Steven Spielberg',156,1,'Tiếng Anh với phụ đề tiếng Việt và lồng tiếng Việt','https://www.cgv.vn/media/banner/cache/1/b58515f018eb873dafa430b6f9ae0c1e/w/s/wss_sneak_980x448.jpg','Được đạo diễn bởi đạo diễn gạo cội từng giành giải Oscar Steven Spielberg, cùng kịch bản bởi biên kịch từng giành giải Pulitzer Prize và giải Tony Award, Tony Kushner, “Câu chuyện phía Tây” kể lại câu chuyện tình yêu kinh điển của Tony và Maria, giữa sự giằng xé của tình yêu trẻ tuổi và sự ngăn cấm, thù hằn ở thành phố NewYork những năm 1950.\",','Câu Chuyện Phía Tây','P - PHIM DÀNH CHO MỌI ĐỐI TƯỢNG','2020-12-20','Câu chuyện phía Tây” kể lại câu chuyện tình yêu kinh điển của Tony và Maria, giữa sự giằng xé của tình yêu trẻ tuổi và sự ngăn cấm, thù hằn ở thành phố NewYork những năm 1950','https://www.cgv.vn/media/catalog/product/cache/1/small_image/240x388/dd828b13b1cb77667d034d5f59a82eb6/p/o/poster_wss_1200x1800__1.jpg','https://www.youtube.com/embed/QPvqV71P0Fo'),(6,'om Holland, Zendaya, Benedict Cumberbatch, Jacob Batalon, Jon Favreau','Hành Động, Phiêu Lưu','Jon Watts',149,1,'Tiếng Anh với phụ đề tiếng Việt và lồng tiếng Việt','https://www.cgv.vn/media/banner/cache/1/b58515f018eb873dafa430b6f9ae0c1e/r/s/rsz_dr-strange-980x448.jpg','Lần đầu tiên trong lịch sử điện ảnh của Người Nhện, thân phận người hàng xóm thân thiện bị lật mở, khiến trách nhiệm làm một Siêu Anh Hùng xung đột với cuộc sống bình thường và đặt người anh quan tâm nhất vào tình thế nguy hiểm. Khi anh nhờ đến giúp đỡ của Doctor Strange để khôi phục lại bí mật, phép thuật đã gây ra lỗ hổng thời không, giải phóng những ác nhân mạnh mẽ nhất từng đối đầu với Người Nhện từ mọi vũ trụ. Bây giờ, Peter sẽ phải vượt qua thử thách lớn nhất của mình, nó sẽ thay đổi không chỉ tương lai của chính anh mà còn là tương lai của cả Đa Vũ Trụ','Người Nhện: Không Còn Nhà','C13 - PHIM CẤM KHÁN GIẢ DƯỚI 13 TUỔI','2020-12-20','Đa vũ trụ được mở ra, những kẻ phản diện nào sẽ trạm chán spidey, cùng đón xem nhá','https://www.cgv.vn/media/catalog/product/cache/1/small_image/240x388/dd828b13b1cb77667d034d5f59a82eb6/s/n/snwh_poster_bluemontage_4x5fb_1__1.jpg','https://www.youtube.com/embed/daHCu_jU5mQ'),(7,'Ellen Burstyn, Max Von Sydow, Lee J. Cobb, Kitty Winn, Jack Macgowran, Jason Miller, Linda Blair, William O*malley, Peter Masterson, Barton Heyman, Rudolf Schündler, Gina Petrushka, Robert Symonds, Arthur Storch, Thomas Bermingham','Kinh dị','William Friedkin',150,1,'Tiếng Anh với phụ đề tiếng Việt và lồng tiếng Việt','https://i.imgur.com/zL4pYaB.png','Quỷ Ám là một bộ phim kinh dị hay nhất mọi thời đại do Mỹ sản xuất vào năm 1973. Bộ phim được lấy cảm hứng từ nghi thức trừ tà có thật của Roland Doe vào năm 1949 trong quyển tiểu thuyết cùng tên của nhà văn W.P.Blatty. Bộ phim kinh dị Quỷ Ám kể về cô bé Regan (Linda Blair) sống cùng mẹ tại Washington đã có những biểu hiện như trúng tà sau khi cầu cơ. Regan từ một cô bé xinh đẹp đã dần trở nên hoang dại luôn tự nói tục không ngớt, cáu giật bất thường,... Mặc dù đã tích cực điều trị nhưng tình tình của cô bé càng trở nên xấu đi và người mẹ của cô - Chris (Ellen Burstyn) đã phải nhờ đến nghi thức trừ tà...','The Exorcist - Quỷ Ám','C18 - PHIM CẤM KHÁN GIẢ DƯỚI 18 TUỔI','2020-12-20','Quỷ Ám là một bộ phim kinh dị hay nhất mọi thời đại do Mỹ sản xuất vào năm 1973. Bộ phim được lấy cảm hứng từ nghi thức trừ tà có thật của Roland Doe vào năm 1949 trong quyển tiểu thuyết cùng tên của nhà văn W.P.Blatty. ','https://i.imgur.com/zZuYfPZ.png','https://www.youtube.com/embed/rSpudl1tsxw'),(8,'Benedict Cumberbatch, Elizabeth Olsen, Chiwetel Ejiofor, Benedict Wong, Xochitl Gomez','Hành Động, Phiêu Lưu','Sam Raimi',126,1,'Tiếng Anh với phụ đề tiếng Việt và lồng tiếng Việt','https://i.imgur.com/0y8YuRW.png','Sự kiện xảy sau phần phim Người Nhện: Không còn nhà (2021) và mùa đầu tiên của Loki (2021), Bác sĩ Stephen Strange đã sử dụng một phét thuật bị cấm và mở ra cánh cổng dẫn tới đa vũ trụ, vô tình dẫn đưa một biến thể hắc ám của Stephen Strange khác đến vũ trụ mình - mối đe dọa lớn mà Dr. Strange có thể phải đối đầu hoặc hợp sức chống lại một cái ác khác, đồng hành cùng Strange còn có Wong và Wanda Maximoff cùng với nhân vật mới American Chavez.','Doctor Strange 2: Đa vũ trụ hỗn loạn','C13 - PHIM CẤM KHÁN GIẢ DƯỚI 13 TUỔI','2020-12-20','Sự kiện xảy sau phần phim Người Nhện: Không còn nhà (2021) và mùa đầu tiên của Loki (2021), Bác sĩ Stephen Strange đã sử dụng một phét thuật bị cấm và mở ra cánh cổng dẫn tới đa vũ trụ','https://i.imgur.com/lxFrvKq.png','https://www.youtube.com/embed/nBNtRvpCmms'),(9,'Laura Dern, Sam Neill, Jeff Goldblum, Chris Pratt, Bryce Dallas Howard','Hành động','Colin Trevorrow',147,1,'Tiếng Anh với phụ đề tiếng Việt và lồng tiếng Việt','https://i.imgur.com/XAHiJM0.png',' Bốn năm sau kết thúc Jurassic World: Fallen Kingdom, những con khủng long đã thoát khỏi nơi giam cầm và tiến vào thế giới loài người. Giờ đây, chúng xuất hiện ở khắp mọi nơi. Sinh vật to lớn ấy không còn chỉ ở trên đảo như trước nữa mà gần ngay trước mắt, thậm chí còn có thể chạm tới. Owen Grady may mắn gặp lại cô khủng long mà anh và khán giả vô cùng yêu mến - Blue. Tuy nhiên, Blue không đi một mình mà còn đem theo một chú khủng long con khác. Điều này khiến Owen càng quyết tâm bảo vệ mẹ con cô được sinh sống an toàn. ','Jurassic World: Dominion','C13 - PHIM CẤM KHÁN GIẢ DƯỚI 13 TUỔI','2020-12-20',' Bốn năm sau kết thúc Jurassic World: Fallen Kingdom, những con khủng long đã thoát khỏi nơi giam cầm và tiến vào thế giới loài người. Giờ đây, chúng xuất hiện ở khắp mọi nơi. Sinh vật to lớn ấy không còn chỉ ở trên đảo như trước nữa mà gần ngay trước mắt, thậm chí còn có thể chạm tới','https://i.imgur.com/Yvjhe4v.png','https://www.youtube.com/embed/X0Peh-AClUM');
